DROP VIEW IF EXISTS `suSecurityUserAsManyOrgView`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `suSecurityUserAsManyOrgView` AS select `suSecurityUser`.`id` AS `id`,`suSecurityUser`.`loginName` AS `loginName`,`suSecurityUser`.`name` AS `name`,`suSecurityUser`.`pwd` AS `pwd`,`suSecurityUser`.`createDate` AS `createDate`,`suSecurityUser`.`lastLoginDate` AS `lastLoginDate`,`suSecurityUser`.`startus` AS `startus`,`suSecurityUser`.`viewIndex` AS `viewIndex`,`suSecurityUser`.`roleCode` AS `roleCode`,`suSecurityUser`.`roleName` AS `roleName`,`suSecurityUser`.`phone_number` AS `phone_number`,`suSecurityUser`.`agent_level` AS `agent_level`,`suSecurityUser`.`agent_information` AS `agent_information`,`suSecurityUser`.`alias1` AS `alias1`,`suSecurityUser`.`alias2` AS `alias2`,`suSecurityUser`.`alias3` AS `alias3`,`suSecurityUser`.`alias4` AS `alias4`,`suSecurityUser`.`alias5` AS `alias5`,`suSecurityUser`.`taskCount` AS `taskCount`,`suSecurityUser`.`finishTaskCount` AS `finishTaskCount`,`suSecurityUser`.`notFinishTaskCount` AS `notFinishTaskCount`,`suSecurityUser`.`agentZLInfo` AS `agentZLInfo`,(select group_concat(`suSecurityUserOrg`.`orgCode` separator ',') from `suSecurityUserOrg` where (`suSecurityUserOrg`.`loginName` = `suSecurityUser`.`loginName`) group by `suSecurityUserOrg`.`loginName`) AS `organizationCode`,`suSecurityUser`.`companyId` AS `companyId`,`suSecurityUser`.`companyName` AS `companyName`,`suSecurityUser`.`lastModifyPassword` AS `lastModifyPassword`,`suSecurityUser`.`departmentId` AS `departmentId`,`suSecurityUser`.`departmentName` AS `departmentName` from `suSecurityUser` ;

-- ----------------------------
-- View structure for VT_JiQiRenFuWuDAY
-- ----------------------------
DROP VIEW IF EXISTS `VT_JiQiRenFuWuDAY`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `VT_JiQiRenFuWuDAY` AS select date_format(`securityDBS`.`VT_ChatSession`.`inboundTime`,'%Y-%m-%d 00:00:00') AS `workDate`,count((case when (`securityDBS`.`VT_ChatSession`.`BotTalkCount` > 0) then 0 end)) AS `BotCountFuwu`,sum(`securityDBS`.`VT_ChatSession`.`BotTalkCount`) AS `BotTalkCount`,ifnull(round((sum(`securityDBS`.`VT_ChatSession`.`BotTalkCount`) / count((case when (`securityDBS`.`VT_ChatSession`.`BotTalkCount` > 0) then 0 end))),2),0) AS `avgBotTalkCount`,ifnull(count((case when ((`securityDBS`.`VT_ChatSession`.`cusType` = '微信客户') and (`securityDBS`.`VT_ChatSession`.`BotTalkCount` > 0)) then 0 end)),0) AS `WenXinBotFuwu`,ifnull(sum((case when (`securityDBS`.`VT_ChatSession`.`cusType` = '微信客户') then `securityDBS`.`VT_ChatSession`.`BotTalkCount` end)),0) AS `WeiXinBotTalk`,ifnull(round((ifnull(sum((case when (`securityDBS`.`VT_ChatSession`.`cusType` = '微信客户') then `securityDBS`.`VT_ChatSession`.`BotTalkCount` end)),0) / ifnull(count((case when ((`securityDBS`.`VT_ChatSession`.`cusType` = '微信客户') and (`securityDBS`.`VT_ChatSession`.`BotTalkCount` > 0)) then 0 end)),0)),0),0.00) AS `avgWenXinBot`,ifnull(count((case when ((`securityDBS`.`VT_ChatSession`.`chatBeginTime` >= '2013-01-01 00:00:00') and (`securityDBS`.`VT_ChatSession`.`solvePerd` > 0)) then 0 end)),0) AS `accCSRCount`,sum(`securityDBS`.`VT_ChatSession`.`agentAnsCount`) AS `agentAnsCount`,ifnull(round((sum(`securityDBS`.`VT_ChatSession`.`agentAnsCount`) / count((case when ((`securityDBS`.`VT_ChatSession`.`chatBeginTime` >= '2013-01-01 00:00:00') and (`securityDBS`.`VT_ChatSession`.`solvePerd` > 0)) then 0 end))),2),0) AS `avgAnsCount` from `VT_ChatSession` group by date_format(`securityDBS`.`VT_ChatSession`.`inboundTime`,'%Y-%m-%d 00:00:00') ;

-- ----------------------------
-- View structure for VT_JiQiRenFuWuMONTH
-- ----------------------------
DROP VIEW IF EXISTS `VT_JiQiRenFuWuMONTH`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `VT_JiQiRenFuWuMONTH` AS select date_format(`securityDBS`.`VT_ChatSession`.`inboundTime`,'%Y-%m-01 00:00:00') AS `workDate`,count((case when (`securityDBS`.`VT_ChatSession`.`BotTalkCount` > 0) then 0 end)) AS `BotCountFuwu`,sum(`securityDBS`.`VT_ChatSession`.`BotTalkCount`) AS `BotTalkCount`,ifnull(round((sum(`securityDBS`.`VT_ChatSession`.`BotTalkCount`) / count((case when (`securityDBS`.`VT_ChatSession`.`BotTalkCount` > 0) then 0 end))),2),0) AS `avgBotTalkCount`,ifnull(count((case when ((`securityDBS`.`VT_ChatSession`.`cusType` = '微信客户') and (`securityDBS`.`VT_ChatSession`.`BotTalkCount` > 0)) then 0 end)),0) AS `WenXinBotFuwu`,ifnull(sum((case when (`securityDBS`.`VT_ChatSession`.`cusType` = '微信客户') then `securityDBS`.`VT_ChatSession`.`BotTalkCount` end)),0) AS `WeiXinBotTalk`,ifnull(round((ifnull(sum((case when (`securityDBS`.`VT_ChatSession`.`cusType` = '微信客户') then `securityDBS`.`VT_ChatSession`.`BotTalkCount` end)),0) / ifnull(count((case when ((`securityDBS`.`VT_ChatSession`.`cusType` = '微信客户') and (`securityDBS`.`VT_ChatSession`.`BotTalkCount` > 0)) then 0 end)),0)),0),0.00) AS `avgWenXinBot`,ifnull(count((case when ((`securityDBS`.`VT_ChatSession`.`chatBeginTime` >= '2013-01-01 00:00:00') and (`securityDBS`.`VT_ChatSession`.`solvePerd` > 0)) then 0 end)),0) AS `accCSRCount`,sum(`securityDBS`.`VT_ChatSession`.`agentAnsCount`) AS `agentAnsCount`,ifnull(round((sum(`securityDBS`.`VT_ChatSession`.`agentAnsCount`) / count((case when ((`securityDBS`.`VT_ChatSession`.`chatBeginTime` >= '2013-01-01 00:00:00') and (`securityDBS`.`VT_ChatSession`.`solvePerd` > 0)) then 0 end))),2),0) AS `avgAnsCount` from `VT_ChatSession` group by date_format(`securityDBS`.`VT_ChatSession`.`inboundTime`,'%Y-%m-01 00:00:00') ;

-- ----------------------------
-- View structure for VT_SkillGroupHourDAYAlert
-- ----------------------------
DROP VIEW IF EXISTS `VT_SkillGroupHourDAYAlert`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `VT_SkillGroupHourDAYAlert` AS select `securityDBS`.`VT_SkillGroupHour`.`skillGroupID` AS `skillGroupID`,`securityDBS`.`VT_SkillGroupHour`.`workDate` AS `workDate`,`securityDBS`.`VT_SkillGroupHour`.`accRate` AS `accRate`,`securityDBS`.`VT_SkillGroupHour`.`accTelRate15` AS `accTelRate15`,`securityDBS`.`VT_SkillGroupHour`.`accTelRate20` AS `accTelRate20`,`securityDBS`.`VT_SkillGroupHour`.`MYDRate` AS `MYDRate` from `VT_SkillGroupHour` USE INDEX (`workDate`) where ((`securityDBS`.`VT_SkillGroupHour`.`callSkExtConnectCount` > 0) and ((`securityDBS`.`VT_SkillGroupHour`.`accRate` < 0.85) or ((`securityDBS`.`VT_SkillGroupHour`.`accTelRate15` < 0.75) and (`securityDBS`.`VT_SkillGroupHour`.`accTelRate20` < 0.75)) or ((`securityDBS`.`VT_SkillGroupHour`.`MYDRate` < 0.75) and (`securityDBS`.`VT_SkillGroupHour`.`MYAllCount` > 0)))) ;

