DROP VIEW IF EXISTS `VT_WeiXinFuWuDAY`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `VT_WeiXinFuWuDAY` AS select date_format(`securityDBS`.`VT_ChatSession`.`inboundTime`,'%Y-%m-%d 00:00:00') AS `workDate`,`securityDBS`.`VT_ChatSession`.`businessType1` AS `businessType1`,count((case when (`securityDBS`.`VT_ChatSession`.`CSRBeginTime` >= '2013-01-01 00:00:00') then 0 end)) AS `transCSRCount`,count((case when ((`securityDBS`.`VT_ChatSession`.`chatBeginTime` >= '2013-01-01 00:00:00') and (`securityDBS`.`VT_ChatSession`.`solvePerd` > 0)) then 0 end)) AS `accCSRCount`,ifnull(round((count((case when ((`securityDBS`.`VT_ChatSession`.`chatBeginTime` >= '2013-01-01 00:00:00') and (`securityDBS`.`VT_ChatSession`.`solvePerd` > 0)) then 0 end)) / count((case when (`securityDBS`.`VT_ChatSession`.`CSRBeginTime` >= '2013-01-01 00:00:00') then 0 end))),2),0.00) AS `accRate` from `VT_ChatSession` where (`securityDBS`.`VT_ChatSession`.`cusType` = '微信客户') group by date_format(`securityDBS`.`VT_ChatSession`.`inboundTime`,'%Y-%m-%d 00:00:00'),`securityDBS`.`VT_ChatSession`.`businessType1` ;

